import logo from './logo.svg';
import './App.css';
import { FaPlus, FaShare } from "react-icons/fa";
function App() {
  return (
    <div className="wrapper">
      <Card
        img='\Customer Engagementfirst_img.png' title='Customer Engagement' subtitle="Get your own mobile app for industry specific"
        price=" 100 DTSU*"
      />
    </div>
  );
}
function Card(props) {
  return (
    <div className='card'>
      <div className='card_body'>
        <img src={props.img} />
        <div>
        <p className='card_title'>
          {props.title}
        </p>
        <p className='card_title'>{props.subtitle}</p>
        <p className='card_price'>
          {props.price}
        </p>
        <FaPlus className='icon' /><FaShare className='icon' />
      </div>
      </div>
    </div>
  );
}
export default App;
